import itertools
import gmpy2
import tqdm


def add(a, b, n):
    if a == 0:
        return b
    if b == 0:
        return a
    l = ((b[1] - a[1]) * gmpy2.invert(b[0] - a[0], n)) % n
    x = (l * l - a[0] - b[0]) % n
    y = (l * (a[0] - x) - a[1]) % n
    return (x, y)


def double(a, A, n):
    if a == 0:
        return a
    l = ((3 * a[0] * a[0] + A) * gmpy2.invert(2 * a[1], n)) % n
    x = (l * l - 2 * a[0]) % n
    y = (l * (a[0] - x) - a[1]) % n
    return (x, y)


def multiply(point, exponent, A, n):
    r0 = 0
    r1 = point
    for i in bin(exponent)[2:]:
        if i == '0':
            r1 = add(r0, r1, n)
            r0 = double(r0, A, n)
        else:
            r0 = add(r0, r1, n)
            r1 = double(r1, A, n)
    return r0


